import React from "react";
import UserCell from "./UserCell/index";

const CodingUserList = ({codingUsers, selectedSectionId, onSelectUser}) => {
  return (
    <div className="gx-chat-user">
      {codingUsers.map((code, index) =>
        <UserCell key={index} code={code} selectedSectionId={selectedSectionId} onSelectUser={onSelectUser}/>
      )}
    </div>
  )
};

export default CodingUserList;
